// MainRouter.js
import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { supabase } from './supabaseClient';

import WelcomePage from './WelcomePage';
import Login from './Login';
import Signup from './Signup';
import Dashboard from './Dashboard';
import UserPreferences from './UserPreferences';
import ThankYou from './ThankYou';

const MainRouter = () => {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);

  // Check for an authenticated user session
  useEffect(() => {
    const checkUserSession = async () => {
      const { data, error } = await supabase.auth.getSession();

      if (error || !data.session) {
        setUser(null); // No session found, user is logged out
      } else {
        setUser(data.session.user); // User is logged in
      }
      setLoading(false);
    };

    checkUserSession();

    // Listen for changes in authentication state
    const { data: authListener } = supabase.auth.onAuthStateChange((event, session) => {
      if (session) {
        setUser(session.user);
      } else {
        setUser(null);
      }
    });

    // Clean up the auth state listener when component unmounts
    return () => {
      authListener.unsubscribe();
    };
  }, []);

  if (loading) {
    return <div>Loading...</div>; // Show loading spinner while checking auth
  }

  return (
    <Router>
      <Routes>
        {/* Public Routes */}
        <Route path="/" element={<WelcomePage />} />
        <Route path="/login" element={!user ? <Login /> : <Navigate to="/dashboard" />} />
        <Route path="/signup" element={!user ? <Signup /> : <Navigate to="/dashboard" />} />
        <Route path="/thankyou" element={<ThankYou />} />

        {/* Protected Routes */}
        <Route path="/dashboard" element={user ? <Dashboard /> : <Navigate to="/login" />} />
        <Route path="/preferences" element={user ? <UserPreferences /> : <Navigate to="/login" />} />

        {/* Catch-all for unknown routes */}
        <Route path="*" element={<Navigate to="/" />} />
      </Routes>
    </Router>
  );
};

export default MainRouter;
